    - ! "Paul Allison has been been teaching and learning ever since he graduated
      from Hunter College, CUNY in 1983. After a few years in the desert (Utah), and
      a couple of years at the High School of Art and Design, NYC, he had a wonderful
      dozen years at University Heights Secondary School, Bronx, NY, where he learned
      that doing school better didn’t have to be the same-old, with more effort. After
      that, Paul worked with English Language Learners at the International High School
      in Queens for three years.\r\n\r\nAfter 9/11, there was a lot of talk about
      doing meaningful work. At the same time, Paul was finding himself being seduced
      by new forms of literacy on the Internet. An opportunity to become a “studio
      teacher” of technology at East Side Community High School, NYC presented itself
      in the Summer of 2002, and Paul taught \"New Journalism\" at ESCHS for five
      years. In the Fall of 2007, Paul moved back the the Bronx to teach \"New Journalism\"
      in grades 6 -12 at East Bronx Academy for the Future, then he taught English
      for three years at the East-West School for International Studies.\r\n\r\nCurrently
      Paul teaches English at the Bronx Academy Senior High. bronxbash.com\r\n\r\nAnother
      community that Paul is a part of is the New York City Writing Project. He was
      a participant in the NYCWP’s Summer Invitational in 1985, and he has worked
      for the NYCWP in various ways ever since Paul is the NYC Technology Liaison
      for the National Writing Project."
