      force to be reckoned with and click shifting was considered revolutionary. Trey’s
      cycling interest led him to triathlon where he competed in the North Carolina
      Triathlon Series placing in the top five in his age group in 2004. After getting
      a taste for the mid distance triathlons, Trey turned his sights to long course
      work and in 2005 he completed Ironman Arizona. Arriving in Austin in May of
      2008, he left the swimming and running behind to concentrate on his true passion
      - cycling. “I love to ride my bike. I wake up every day and know that I have
      the coolest job in the world. And not just because I’m riding my bike. But because
      I’m sharing the knowledge it took me 20 years to learn. And in just six to eight
