    - ! 'Ruby Meta Programming '
    - ! "<p>I've been working in Ruby and Rails for the past 3 years working as the
      lead developer on OpenPHIN (https://github.com/talho/openphin).  I am also the
      author of a MTI plugin for ActiveRecord called Pin Cushion (https://github.com/Dishwasha/pin_cushion).
