      for OpenPHIN and general temporary Rails and gem bug fixing without having to
      fork.  The class will cover the Ruby object model, discuss the differences between
      Proc and Lambda and how to use them, method_missing and various evals, and how
      to use meta-programming techniques effectively in Rails and plugins/gems.</p>\r\n<br/>\r\n<p>This
      will be a hands-on course so bring a laptop with Ruby installed.  It is best
