  - - 156
    - ! 'Ideation technique - concept mapping '
    - ! "<p>Some of us let ideas sit in our heads for too long. Some of us go straight
      to coding. Some of us don't think we have good ideas at all!</p>\r\n<p>Concept
      mapping has been the most powerful tool I've used to externalize thoughts in
      my head out onto paper, and in the process, flushing out the connective pieces
      that were missing. Concept mapping itself is a generative process, meaning if
      you don't think you have a lot to start with, you will be surprised how much
      you end up with. </p>\r\n<p>If you can do lines, circles, and boxes - that's
      about all the drawing skills you need. Come join me for the hour and learn about:
      \ </p>\r\n\r\n- basic concept mapping\r\n- semantic zoom (ecosystem)\r\n- temporal
      zoom (customer journey map)"
